          strokeWeight: 2,
          fillColor: '#FF0000',
          fillOpacity: 0.35,
          map: _this.map,
          center: new google.maps.LatLng(tweet.lat, tweet.lng),
          radius: tweet.percentage * 50000 // convert count to meters
        };

        var circle = new google.maps.Circle(circleOptions);
        circle.addListener('mouseover', function () {
          _this.showInfoWindow(circle, tweet.name, tweet.count, tweet.total, tweet.percentage);
        });
        circle.addListener('mouseout', function () {
          _this.hideInfoWindow();
        });
        _this.circles.push(circle);
      });
    },
    showInfoWindow: function showInfoWindow(circle, count, percentage) {
